import React, { FunctionComponent } from 'react';

import Profile from "./profile";
import Search from "./search";
// import Message from "./message";

const Dashboard: FunctionComponent = () => {
    return (
        <div>
            <Profile/>
            <Search/>
            <Message />
        </div>
    );
}

export default Dashboard;
